import classes from "./Board.module.css";
import Status from "./components/BoardComp/Status";
import ProductList from "./components/BoardComp/ProductList";

const Board = () => {
  return (
    <div className={classes.container}>
      <Status />
      <ProductList />
    </div>
  );
};

export default Board;
